import styled from "styled-components";

export const MainConteiner = styled.div`
  @media (max-width: 768px) {
    display: flex;
    flex-flow: wrap;
    padding-right: 22px;
  }
`;

export const IconsConteiner = styled.div`
  padding-left: 12px;
  margin-top: 23px;
  display: flex;
  grid-gap: 12px;
  @media (max-width: 768px) {
    display: flex;
    flex-flow: wrap;
    padding-right: 22px;
  }
`;

export const Vector = styled.div`
  height: 1px;
  border-top: solid 1.7px #060606;
  margin-top: 23px;
`;
